import React from 'react'
import AChart from "react-apexcharts";

const Seeds= ({todos, options}) =>{
    let a=[];
    const todoList = todos.length ? (
        todos.map( (todo, index) => {
            a.push(index)
            let option = Object.assign(options, {chart: {...options.chart,id:'chart-'.concat(index)}});
            console.log('chart-'.concat(index))
            console.log(option)
            console.log(a)
            //option.chart.id ='chart-'.concat(index);
            option.title.text = todos[index].name;
            return(
                <div className="col s6" key={index}>
                    <div className="card">
                        <AChart
                        options={option}
                        series={[todo]}/>
                    </div>
                </div>
            );
        }
        )
    ) : (
        <p className="center">Loading</p>
    );
    return(
        <div className="container">
            <div className="row">
                {todoList}
            </div>
        </div>
    );
}

export default Seeds;
